INSERT INTO "public"."sys_config" VALUES (1, '创建交易记录序列', 'format_create_sequence', 'CREATE SEQUENCE IF NOT EXISTS {0};', '判断序列存在，不存在则创建', 1, '2020-08-03 17:18:53.009148', NULL);
INSERT INTO "public"."sys_config" VALUES (2, '创建schema模板', 'format_create_schema', 'CREATE SCHEMA IF NOT EXISTS "{0}" AUTHORIZATION postgres;', 'schema的创建模板，用于创建schema', 1, '2020-08-03 17:23:49.612734', NULL);
INSERT INTO "public"."sys_config" VALUES (3, '创建交易记录表模板', 'format_create_trade_record_table', 'CREATE TABLE IF NOT EXISTS "{0}"."{1}{2}"("id" int8 NOT NULL DEFAULT nextval(''trade_record_id_seq''::regclass),"tran_account" int8 NOT NULL,"tran_amount" int8 NOT NULL,"tran_number" int4 NOT NULL,"tran_total" int8 NOT NULL,"tran_time" timestamp(0) NOT NULL,"creation_time" timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP,"tran_order" varchar(128) COLLATE "pg_catalog"."default" NOT NULL,"tran_ip" varchar(128) COLLATE "pg_catalog"."default" NOT NULL,"phone_number" varchar(32) COLLATE "pg_catalog"."default" NOT NULL,"phone_meid" varchar(128) COLLATE "pg_catalog"."default" NOT NULL,"phone_model" varchar(128) COLLATE "pg_catalog"."default","tran_type" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,"tran_payer" varchar(255) COLLATE "pg_catalog"."default","tran_target" varchar(255) COLLATE "pg_catalog"."default",CONSTRAINT "{1}{2}_pkey" PRIMARY KEY ("id"));ALTER TABLE "{0}"."{1}{2}" OWNER TO "postgres";CREATE INDEX IF NOT EXISTS "i_account_{2}" ON "{0}"."{1}{2}" USING btree ("tran_account" "pg_catalog"."int8_ops");COMMENT ON COLUMN "{0}"."{1}{2}"."id" IS ''主键'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_account" IS ''账号'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_amount" IS ''交易金额'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_number" IS ''一天的交易次数'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_total" IS ''一天的交易总金额'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_time" IS ''交易时间'';COMMENT ON COLUMN "{0}"."{1}{2}"."creation_time" IS ''创建时间'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_order" IS ''交易的订单号'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_ip" IS ''IP地址'';COMMENT ON COLUMN "{0}"."{1}{2}"."phone_number" IS ''手机号码'';COMMENT ON COLUMN "{0}"."{1}{2}"."phone_meid" IS ''手机设备号'';COMMENT ON COLUMN "{0}"."{1}{2}"."phone_model" IS ''手机型号'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_type" IS ''交易类型'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_payer" IS ''交易付款方'';COMMENT ON COLUMN "{0}"."{1}{2}"."tran_target" IS ''交易目标账号'';COMMENT ON TABLE "{0}"."{1}{2}" IS ''交易记录表'';COMMENT ON INDEX "{0}"."i_account_{2}" IS ''账号索引'';', '用于创建每日的交易记录表', 1, '2020-08-03 18:00:44.034566', NULL);

